import '../styles.css';

const navBar = ({navBar}) => { 
    return(<div className="navBar">
        <button >{"Hello"}</button>
        <button>{"Hello 1"}</button>
        <button>{"Hello 2"}</button>
    </div>) 
}

export default navBar;
